css:
.github-RecentCommits {
  max-height: 81px;
  overflow-x: hidden;
  overflow-y: auto;
  border-top: 1px solid #171717;
}
.github-RecentCommits-list {
  margin: 0;
  padding: 4px 0;
  list-style: none;
}
.github-RecentCommits-message {
  padding: 4px 8px;
  text-align: center;
  color: #818181;
}
.github-RecentCommit {
  position: relative;
  display: flex;
  align-items: center;
  padding: 0 8px;
  line-height: 24px;
}
.github-RecentCommit-authors {
  position: absolute;
  display: flex;
}
.github-RecentCommit-avatar {
  position: relative;
  margin-right: -13px;
  width: 16px;
  height: 16px;
  border-radius: 2px;
  background-color: #1d1d1d;
  box-shadow: 1px 0 #000;
  transition: margin 0.12s cubic-bezier(0.5, 0.1, 0, 1);
}
.github-RecentCommit-avatar:nth-child(1) {
  z-index: 3;
}
.github-RecentCommit-avatar:nth-child(2) {
  z-index: 2;
  opacity: .7;
}
.github-RecentCommit-avatar:nth-child(3) {
  z-index: 1;
  opacity: .4;
}
.github-RecentCommit-avatar:nth-child(n+4) {
  display: none;
}
.github-RecentCommit-avatar:only-child,
.github-RecentCommit-avatar:last-child {
  box-shadow: none;
}
.github-RecentCommit-authors:hover .github-RecentCommit-avatar {
  display: inline-block;
  margin-right: 1px;
  opacity: 1;
}
.github-RecentCommit-message {
  flex: 1;
  margin: 0 .5em;
  margin-left: 24px;
  text-overflow: ellipsis;
  white-space: nowrap;
  overflow: hidden;
}
.github-RecentCommit-undoButton.btn {
  padding: 0 5.33333333px;
  margin-right: 4px;
  height: 20px;
  line-height: 1;
  font-size: .9em;
}
.github-RecentCommit-time {
  color: #818181;
}
.github-RecentCommit:hover {
  color: #F8F8F0;
  background: #0d0d0d;
}
.github-RecentCommit.is-selected {
  color: #cecece;
  background: #181818;
}
.github-RecentCommits:focus .github-RecentCommit.is-selected {
  color: #ffffff;
  background: #1a1a1a;
}
@media (min-height: 900px) {
  .github-RecentCommits {
    max-height: 129px;
  }
}
@media (min-height: 1200px) {
  .github-RecentCommits {
    max-height: 249px;
  }
}
